const fetchNEOs = (startDate, endDate) => {
  return fetch(`https://api.nasa.gov/neo/rest/v1/feed?start_date=${startDate}&end_date=${endDate}&api_key=DEMO_KEY`).then((response) => response.json())

}

export default fetchNEOs
